import com.sun.deploy.util.ArrayUtil;

import java.util.*;

public class Main {
    public static void main(String[] args) {
        List<Integer> res=findAnagrams("cbaebabacd","abc");
        String s="";
        String p="";
        List<Integer> res2=findAnagrams2(s,p);
        System.out.println(1);
    }
    public static List<Integer> findAnagrams2(String s,String p){
        List<Integer> res=new ArrayList<>();
        Map<Character,Integer> need=new HashMap<>();
        Map<Character,Integer> window=new HashMap<>();
        for(int i=0;i<p.length();i++){
            char c=p.charAt(i);
            if(need.containsKey(c)){
                need.put(c,need.get(c)+1);
            }else{
                need.put(c,1);
            }
        }
        int left=0,right=0;
        int match=0;
        while(right<s.length()){
            char tmp=s.charAt(right);
            if(window.containsKey(tmp)){
                window.put(tmp,window.get(tmp)+1);
            }else{
                window.put(tmp,1);
            }
            if(right==9999){
                System.out.println(1);
            }
            if(need.containsKey(tmp)){
                if(window.get(tmp).equals(need.get(tmp))){
                    match++;
                }
            }
            right++;
            while(match==need.size()){
                if(right-left==p.length()){
                    res.add(left);
                }
                window.put(s.charAt(left),window.get(s.charAt(left))-1);
                if(need.containsKey(s.charAt(left))){
                    if(window.get(s.charAt(left))<need.get(s.charAt(left))){
                        match--;
                    }
                }
                left++;
            }
        }
        return res;
    }
    public static List<Integer> findAnagrams(String s, String p) {
        List<Integer> res=new ArrayList<>();
        String ques=stringSort(p);
        for(int i=0;i<=s.length()-p.length();i++){
            String temp=s.substring(i,i+p.length());
            String tmp=stringSort(temp);
            if(ques.equals(tmp)){
                res.add(i);
            }
        }
        return res;
    }
    public static String stringSort(String s){
        char[] sArr=s.toCharArray();
        Character[] cArr=new Character[sArr.length];

        for(int i=0;i<sArr.length;i++){
            cArr[i]=sArr[i];
        }

        Arrays.sort(cArr, new Comparator<Character>() {
            @Override
            public int compare(Character o1, Character o2) {
                return o1.compareTo(o2);
            }
        });
        StringBuilder sb=new StringBuilder();
        for(char c:cArr){
            sb.append(c);
        }
        return sb.toString();
    }
}
